script: |
  super -f text -I q5265.spq | sort > q5265.out

inputs:
  - name: q5265.spq
    data: |
      SELECT DISTINCT col1 * col0 + CAST ( col0 + col0 / col0 AS INTEGER ) * col1 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 BETWEEN col2 AND + + col1 * + col2;
  - name: tab2

outputs:
  - name: q5265.out
    data: |
